/* Function  structure for function  `getSaldoActual` */

/*!50003 DROP FUNCTION IF EXISTS `getSaldoActual` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getSaldoActual`(p_id_cuenta int, p_fecha date) RETURNS float
BEGIN
	
	DECLARE saldoActual FLOAT;
	-- declare fechaApertura varchar(10);
	SELECT sum(apt.importe) INTO saldoActual FROM apunte apt, cuenta cta 
	where cta.id_cuenta=apt.id_cuenta
	and apt.id_cuenta=p_id_cuenta
	and apt.fecha<=p_fecha;
	RETURN saldoActual;
	END */$$
DELIMITER ;

