/*View structure for view vista_apuntes_groupby_clases */

/*!50001 DROP TABLE IF EXISTS `vista_apuntes_groupby_clases` */;
/*!50001 DROP VIEW IF EXISTS `vista_apuntes_groupby_clases` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`itertek01galea`@`localhost` SQL SECURITY DEFINER VIEW `vista_apuntes_groupby_clases` AS (select concat(substr(`apt`.`fecha`,1,4),`cl`.`id_clase`) AS `id_vista`,`gr`.`id_grupo` AS `IDGRUPO`,`gr`.`nombre` AS `GRUPO`,`cl`.`nombre` AS `CLASE`,sum(if((`apt`.`tipo_operacion` = 'INGRESO'),`apt`.`importe`,0)) AS `INGRESOS`,sum(if((`apt`.`tipo_operacion` = 'GASTO'),`apt`.`importe`,0)) AS `GASTOS`,(sum(if((`apt`.`tipo_operacion` = 'INGRESO'),`apt`.`importe`,0)) + sum(if((`apt`.`tipo_operacion` = 'GASTO'),`apt`.`importe`,0))) AS `DIFERENCIAS`,substr(`apt`.`fecha`,1,4) AS `ANIO`,`apt`.`id_cuenta` AS `CUENTA` from ((`apunte` `apt` join `clase` `cl`) join `grupo` `gr`) where ((`cl`.`id_clase` = `apt`.`id_clase`) and (`cl`.`id_grupo` = `gr`.`id_grupo`) and (`apt`.`baja` = 'N') and (`apt`.`traspaso` = 'N')) group by `cl`.`id_clase`,`apt`.`id_cuenta`,substr(`apt`.`fecha`,1,4) order by `gr`.`nombre`,`cl`.`nombre`,`apt`.`id_cuenta`,substr(`apt`.`fecha`,1,4),`gr`.`nombre`) */;

