/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vista_apuntes_groupby_mes` AS (select concat(substr(`apt`.`fecha`,1,4),substr(`apt`.`fecha`,6,2)) AS `id_vista`,sum(if((`apt`.`tipo_operacion` = 'INGRESO'),`apt`.`importe`,0)) AS `INGRESOS`,sum(if((`apt`.`tipo_operacion` = 'GASTO'),`apt`.`importe`,0)) AS `GASTOS`,(sum(if((`apt`.`tipo_operacion` = 'INGRESO'),`apt`.`importe`,0)) + sum(if((`apt`.`tipo_operacion` = 'GASTO'),`apt`.`importe`,0))) AS `DIFERENCIAS`,substr(`apt`.`fecha`,6,2) AS `MESNUMERO`,(case substr(`apt`.`fecha`,6,2) when '01' then 'Enero' when '02' then 'Febrero' when '03' then 'Marzo' when '04' then 'Abril' when '05' then 'Mayo' when '06' then 'Junio' when '07' then 'Julio' when '08' then 'Agosto' when '09' then 'Septiembre' when '10' then 'Octubre' when '11' then 'Noviembre' when '12' then 'Diciembre' end) AS `MES`,substr(`apt`.`fecha`,1,4) AS `ANIO`,`apt`.`id_cuenta` AS `CUENTA` from ((`apunte` `apt` join `clase` `cl`) join `grupo` `gr`) where ((`cl`.`id_clase` = `apt`.`id_clase`) and (`cl`.`id_grupo` = `gr`.`id_grupo`) and (`apt`.`baja` = 'N') and (`apt`.`traspaso` = 'N')) group by `apt`.`id_cuenta`,substr(`apt`.`fecha`,1,4),substr(`apt`.`fecha`,6,2) order by `apt`.`id_cuenta`,substr(`apt`.`fecha`,1,4),substr(`apt`.`fecha`,6,2)) */;

